import React, { useState } from "react";

function NotForm() {
  const [baslik, setBaslik] = useState("");
  const [aciklama, setAciklama] = useState("");
  const [oncelik, setOncelik] = useState("");

  const onSubmit = (e) => {
    e.preventDefault();

    console.log(baslik, aciklama, oncelik);
  };

  return (
    <section className="form">
      <form onSubmit={onSubmit}>
        <div className="form-group">
          <label htmlFor="baslik">not baslik</label>
          <input
            type="text"
            id="baslik"
            name="baslik"
            value={baslik}
            onChange={(e) => setBaslik(e.target.value)}
          />
        </div>
        <div className="form-group">
          <label htmlFor="aciklama">not aciklama</label>
          <input
            type="text"
            id="aciklama"
            name="aciklama"
            value={aciklama}
            onChange={(e) => setAciklama(e.target.value)}
          />
        </div>
        <div className="form-group">
          <label htmlFor="oncelik">not oncelik</label>
          <select onChange={(e) => setOncelik(e.target.value)} value="oncelik"></select>
        </div>
      </form>
    </section>
  );
}

export default NotForm;
